import axios from "axios";

const headers = {
    Accept: "application/json",
    "Content-Type": "application/json"
};


const axiosInstance = axios.create({
    baseURL,
    timeout: 1800000,
    headers
});

export let baseAPIResource = {
    get: (url) => {
        return axiosInstance.get(url);
    }
};
